    20463 Re: Identification Number C00219642, Year End Report (7/01/01 thru 12/31/01)
    Dear Ms. Perry: This letter is in response to your letter dated February 27, 2002.
    The first issue of excessive contributions addressed in your letter was resolved
    by refunding the excessive amounts to the five individuals whose contributions
    exceeded the maximum contribution limit of $5,000 per year. Please find attached,
    copies of the five refund checks and letters to the five contributors explaining
    their refund. These refunds will be reported on Line 28A of our April report.
