    raised in your letter. The two transfers to affiliated PACs were properly reported
    on Line 22, but are now detailed to note the state PAC that received the transferred
    funds. And on the final issue of excessive contributions, the Schedule B disbursement
    to the RoyB Fund was not a contribution to Congressman Roy Blunt''s Campaign,
